import React, { Component } from "react";
import ProgressBar from 'react-bootstrap/ProgressBar'

class About extends Component {
  render() {
    return (
      <div>
        <h2>ABOUT</h2>
        <p>I am a designer and developer.</p>
        <p>My Skillset: </p>
        <div>
          <ul class="skills">
          <li>HTML</li> 
          <ProgressBar now={60} />
          <li>CSS</li>
          <li>Javascript</li>
          <li>ReactJS</li>
          <li>Python</li>
          <li>Java</li>
          <li>C#</li>
          </ul>
        </div>
      </div>
    );
  }
}
 
export default About;
